double GBModel_AABRAHAM::predict(const std::vector<double>& features) {
    if (features.size() != n_features) {
        return 0.0;  // Error: feature count mismatch
    }
    
    double prediction = init_mean;
    auto trees = get_trees();
    
    for (const auto& tree : trees) {
        int node_idx = 0;
        while (true) {
            const auto& node = tree.nodes[node_idx];
            if (node.left_child == node.right_child) {
                // Leaf node
                prediction += learning_rate * node.value;
                break;
            }
            // Internal node - traverse
            if (features[node.feature_idx] <= node.threshold) {
                node_idx = node.left_child;
            } else {
                node_idx = node.right_child;
            }
        }
    }
    
    return prediction;
}

